ok_vector(); } if self.controller.move_left { // If we moving left then add "side" vector of the pivot. velocity += pivot.side_vector(); } if self.controller.move_right { // If we moving right then subtract "side" vector of the pivot. velocity -= pivot.side_vector(); } // Finally new linear velocity. body.set_linvel(velocity, true); // Change the rotation of the rigid body according to current yaw. These lines responsible for // left-right rotation. let mut position = *body.position(); position.rotation = UnitQuaternion::from_axis_angle(&Vector3::y_axis(), self.controller.yaw.to_radians()); body.set_position(position, true); } fn process_input_event(&mut self, event: &Event<()>) { match event { Event::WindowEvent { event, .. } => { if let WindowEvent::KeyboardInput { input, .. } = event { if let Some(key_code) = input.virtual_keycode { match key_code { VirtualKeyCode::W => { self.controller.move_forward = input.state == ElementState::Pressed; } VirtualKeyCode::S => { self.controller.move_backward = input.state == ElementState::Pressed; } VirtualKeyCode::A => { self.controller.move_left = input.state == ElementState::Pressed; } VirtualKeyCode::D => { self.controller.move_right = input.state == ElementState::Pressed; } _ => (), } } } } Event::DeviceEvent { event, .. } => { if let DeviceEvent::MouseMotion { delta } = event { self.controller.yaw -= delta.0 as f32; self.controller.pitch = (self.controller.pitch + delta.1 as f32).clamp(-90.0, 90.0); } } _ => (), } }
